import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class List extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Link to={`/mandal/${this.props.index}`} key={this.props.index} className="mandal-list">{this.props.data.time}</Link>
        )
    }
}

export default List;
